    return(
      <div>
        <img/>
        <h2>{oneTeam.school}</h2>
        <h3>name: {oneTeam.name}</h3>
        <h2>tid: {oneTeam.tid}</h2>
        <h3>cid: {oneTeam.cid}</h3>
        <h3>abbrev: {oneTeam.abbrev}</h3>
        <h3>pop: {oneTeam.pop}</h3>
        <h3>city: {oneTeam.city}</h3>
